// SPDX-License-Identifier: MIT
pragma solidity >=0.5.0 <0.9.0;

contract Lottery {


    address manager=msg.sender;
    address [] public  user;

function pay() public payable{
    require(msg.value== 1 ether,"sorry u not pay");

    user.push(msg.sender);

}

function getBalance() public view returns(uint){
    require(msg.sender==manager);
    return address(this).balance;

}

function random()  public view returns(uint){
    return uint(keccak256(abi.encodePacked(block.difficulty, block.timestamp, user.length)));
        }
function winner() public payable{
    uint d=random();
    uint p=d%user.length;
    user[p];
    // payable(cp).transfer(getBalance());
    user=new address [](0);
}


function getuser() public view returns(address [] memory){
    return user;

}






}
